import React, { Component, useEffect} from 'react';
import { Route, Switch } from 'react-router-dom';
import Profile from './hoc/Menu/Profile';
import Profile_PJ from './hoc/Menu/Profile_PJ';
import styled, { ThemeProvider } from 'styled-components';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import {FaPlus,FaMinus,FaDatabase,FaHtml5,FaCss3,FaPaperclip} from "react-icons/fa";


const AC = styled.div`
.wrapper{
    height:100vh;
    width:100vw;
    position:relative;
    top:400px;
    left:50%;
    transform:translateX(-49%);
}
.accordion{
    width:2000px;
}
.item{
    background:Black;
    margin-bottom:5px;
    padding:10px 20px;
    margin:20px;

}
.title{
    color:white;
    display:flex;
    justify-content:space-between;
    align-items:center;
    ccursor:pointer;

}
.content{

    color:white;
    max-height:0;
    overflow:hidden;
    transition: all 0.5s cubic-bezier(0,1,0,1);

}
.content.show{
    color:white;
    height:auto;

    transition:all 0.5s cubic-bezier(1,0,1,0);
}
`;
function App() {
    // App.js
    const toggle =(i) =>{
        if(selected == i ){
            return setSeleted(null);
        }
        setSeleted(i);
    }
    const [selected,setSeleted]=useState(null);
    const [message, setMessage] = useState("");

    useEffect(() => {
        fetch('/home1')
        .then(response => response.text())
        .then(message => {
        setMessage(message);
        });
        },[])

    return (

        <div>
            <Switch>
                    <Route exact path="/" component={Profile} />
                    <Route path="/Profile_PJ" component={Profile_PJ}/>

            </Switch>
            <AC>
                        <div className='wrapper'>
                    <h1>Project_LIST <FaPaperclip style={{margin:"4px"}} /> </h1>

      <div className="accordion" style={{display:"flex"}}>
        <h1>경기도 공공 체육시설 조회</h1>
        주요 기능 : 경기도에 있는 공공 체육시설들을 조회 할 수 있으며, 위치, 바닥 재질, 시설크기 등을 알 수 있고 검색하여 찾을 수 도 있다.
Frontend : HTML5, CSS3, Javascript
Backend : Java, JSP
DataBase : Mysql

      </div>
      <div className="accordion" style={{display:"flex"}}>
        <h1>로지스틱 회귀모델을 활용한 웹 기반의 인지장애 스크리닝 시스템</h1>
        주요 기능 : 환자들의 데이터를 넣으면 기준 값에 의해 정상인지 비정상인지 결과가 나오고 DB에 저장된다. DB의 저장된 환자들의 데이터로
차트와 그래프를 나타내주고 환자들의 정보 검색을 할 수 있다.
GitHub : https://github.com/GanziMan/Thesis-web-project
Frontend : HTML5, CSS3, Javascript
Backend : Java, JSP
DataBase : Mysql


      </div>
      <br></br>
      </div>

      </AC>

            {/*<Switch2 value={value} onChange={value => setValue(value)} /> */}
            {/*   <ThemeProvider theme={theme}>
                <S.Main>

                    <Button title={theme === 'light' ? '일반모드로 테마 변경하기' : '다크모드로 테마 변경하기'}
                        click={toggleTheme} />

                </S.Main>


    </ThemeProvider>
            */}

        </div>

    );

}



export default App;
const S = {};
S.Main = styled.div`
  width: 100%;
  height: 100vh;
  background-color: ${props => props.theme.colors.bgColor};
`;
